clf;
clc;
clear;
function S_FOA = FOA(S, alpha, wc)
    zeta=tan(alpha*pi/2)+sec(alpha*pi/2);
    S_FOA = (S .* zeta ./ wc + 1) ./ (S ./ wc + zeta) ;
end

function S_SOA = SOA(S, alpha, wc)
    aprox_var_0 = alpha^alpha + 2.*alpha + 1;
    aprox_var_2 = alpha^alpha - 2.*alpha + 1;
    aprox_var_1 = (aprox_var_2 - aprox_var_0) .* tan((2 + alpha) .* pi./4);
    S_center = S ./ wc;
    S_SOA = (aprox_var_0 .* S_center .^2 + aprox_var_1 .* S_center + aprox_var_2)./(aprox_var_2 .* S_center .^2 + aprox_var_1 .* S_center + aprox_var_0);
end


function S_SOA_complex = SOA_COMPLEX(S, alpha, beta, wc)

    % frequency ratio (use magnitude of s; safe at DC with eps)
    omega = abs(S);
    r = max(omega./wc, eps);

    % A1(r) = exp( j*(beta*pi/2) ) * cos( beta*log(r) )
    % A2(r) = exp( j*(beta*pi/2) ) * sin( beta*log(r) )
    A1 = exp(1j*(beta*pi/2)) .* cos(beta.*log(r));
    A2 = exp(1j*(beta*pi/2)) .* sin(beta.*log(r));

    % Core powers
    P0 = (S ./ wc).^alpha;         % (s/wc)^alpha

    % Choose the "+1" branch for differentiator-type usage.
    % (For integrator-type variants, you could switch to (alpha-1) here.)
    P1 = (S./wc).^(alpha + 1);   % (s/wc)^(alpha+1)

    S_SOA_complex = A1 .* P0 + A2 .* P1;
end

%%
alpha = 0.5; %[control:slider:3139]{"position":[9,12]}
beta = 0.3; %[control:slider:2527]{"position":[8,11]}
wc = 10 ^1.6; %[control:slider:3f3d]{"position":[10,13]}
w = logspace(-2, 6, 1000);
s_vals = 1j * w;

exponent = -(alpha + beta*1j);
H_vals_fractinal = (s_vals./wc).^exponent;



H_vals_FO = 1 ./ FOA(s_vals, alpha, wc);
H_vals_SO = 1 ./ SOA(s_vals, alpha, wc);
H_vals_SO_Complex = 1 ./ SOA_COMPLEX(s_vals, alpha, beta, wc);

% Convert to magnitude (dB) and phase (degrees)
magnitude_db_original = 20 * log10(abs(H_vals_fractinal));
magnitude_db_FO = 20 * log10(abs(H_vals_FO));
magnitude_db_SO = 20 * log10(abs(H_vals_SO));
magnitude_db_SO_Complex = 20 * log10(abs(H_vals_SO_Complex));
phase_deg_original = angle(H_vals_fractinal) * 180/pi;
phase_deg_FO = angle(H_vals_FO) * 180/pi;
phase_deg_SO = angle(H_vals_SO) * 180/pi;
phase_deg_SO_Complex = angle(H_vals_SO) * 180/pi;

% Create Bode plot
figure(2);
subplot(2,1,1); %[output:56b6b21f]
slg = semilogx(w, magnitude_db_original, ... %[output:56b6b21f]
                w, magnitude_db_FO, ... %[output:56b6b21f]
                w, magnitude_db_SO, ... %[output:56b6b21f]
                w, magnitude_db_SO_Complex, ... %[output:56b6b21f]
                'LineWidth', 2); %[output:56b6b21f]

slg(1).Color = [1,0,0]; %[output:56b6b21f]
slg(2).Color = [0,0.5,0]; %[output:56b6b21f]
slg(3).Color = [0,0,0.5]; %[output:56b6b21f]
slg(4).Color = [0,0.8,1]; %[output:56b6b21f]


hold on; %[output:56b6b21f]
line([wc wc], [-20 20], 'Color', 'r', 'LineStyle', '--'); %[output:56b6b21f]
hold off; %[output:56b6b21f]

legend("fractional", "First Order", "Second Order", "Second Order Complex") %[output:56b6b21f]
grid on; %[output:56b6b21f]
ylabel('Magnitude (dB)'); %[output:56b6b21f]
title(sprintf('FOA Fractional-Order System: H(s) = s^{%.2f}', exponent)); %[output:56b6b21f]

subplot(2,1,2); %[output:56b6b21f]
slg = semilogx(w, phase_deg_original, ... %[output:56b6b21f]
    w, phase_deg_FO, ... %[output:56b6b21f]
    w, phase_deg_SO, ... %[output:56b6b21f]
    w, phase_deg_SO_Complex, ... %[output:56b6b21f]
    'LineWidth', 2 ); %[output:56b6b21f]

slg(1).Color = [1,0,0]; %[output:56b6b21f]
slg(2).Color = [0,0.5,0]; %[output:56b6b21f]
slg(3).Color = [0,0,0.5]; %[output:56b6b21f]
slg(4).Color = [0,0.8,1]; %[output:56b6b21f]

hold on; %[output:56b6b21f]
line([wc wc], [0 -180], 'Color', 'r', 'LineStyle', '--'); %[output:56b6b21f]
hold off; %[output:56b6b21f]
legend("fractional", "First Order", "Second Order", "Second Order Complex") %[output:56b6b21f]
grid on; %[output:56b6b21f]
ylabel('Phase (degrees)'); %[output:56b6b21f]
xlabel('Frequency (rad/s)'); %[output:56b6b21f]


%%
%[text] ## Percentage Error

% Convert to magnitude (dB) and phase (degrees)
magnitude_FO_perc_error = abs(H_vals_FO) ./ abs(H_vals_fractinal) - 1;
magnitude_SO_perc_error = abs(H_vals_SO) ./ abs(H_vals_fractinal) - 1;
magnitude_SO_Complex_perc_error = abs(H_vals_SO_Complex) ./ abs(H_vals_fractinal) - 1;
phase_deg_FO_perc_error = abs(phase_deg_FO - phase_deg_original) ./ phase_deg_original;
phase_deg_SO_perc_error = abs(phase_deg_SO - phase_deg_original) ./ phase_deg_original;
phase_deg_SO_Complex_perc_error = abs(phase_deg_SO_Complex - phase_deg_original) ./ phase_deg_original;

% Create Bode plot
figure(2);
subplot(2,1,1); %[output:4b270be9]
slg = semilogx(w, magnitude_FO_perc_error, ... %[output:4b270be9]
                w, magnitude_SO_perc_error, ... %[output:4b270be9]
                w, magnitude_db_SO_Complex, ... %[output:4b270be9]
                'LineWidth', 2); %[output:4b270be9]

slg(1).Color = [0,0.5,0]; %[output:4b270be9]
slg(2).Color = [0,0,0.5]; %[output:4b270be9]
slg(3).Color = [0,0.8,1]; %[output:4b270be9]


hold on; %[output:4b270be9]
line([wc wc], [-1 1], 'Color', 'r', 'LineStyle', '--'); %[output:4b270be9]
hold off; %[output:4b270be9]

legend("First Order", "Second Order", "Second Order Complex") %[output:4b270be9]
grid on; %[output:4b270be9]
ylim([-1 1]); %[output:4b270be9]
ylabel('% Erro Magnitude'); %[output:4b270be9]
title(sprintf('FOA Fractional-Order System: H(s) = s^{%.2f} % Error', exponent)); %[output:4b270be9]

subplot(2,1,2); %[output:4b270be9]
slg = semilogx(w, phase_deg_FO_perc_error, ... %[output:4b270be9]
    w, phase_deg_SO_perc_error, ... %[output:4b270be9]
    w, phase_deg_SO_Complex, ... %[output:4b270be9]
    'LineWidth', 2 ); %[output:4b270be9]

slg(1).Color = [0,0.5,0]; %[output:4b270be9]
slg(2).Color = [0,0,0.5]; %[output:4b270be9]
slg(3).Color = [0,0.8,1]; %[output:4b270be9]

hold on; %[output:4b270be9]
line([wc wc], [-1 1], 'Color', 'r', 'LineStyle', '--'); %[output:4b270be9]
hold off; %[output:4b270be9]
legend("First Order", "Second Order", "Second Order Complex") %[output:4b270be9]
grid on; %[output:4b270be9]
ylim([-1 1]); %[output:4b270be9]
ylabel('% Eerro Phase (degrees)'); %[output:4b270be9]
xlabel('Frequency (rad/s)'); %[output:4b270be9]

